import React, { useState } from 'react';
import '../styles/JournalForm.css';

const JournalForm = () => {
  const [formData, setFormData] = useState({
    date: '',
    content: '',
    moodColor: '',
    properNutrition: false,
    properHydration: false,
    hydrationAmount: '',
    properExercise: false,
    exerciseDuration: '',
    exerciseDescription: '',
    hoursOfSleep: '',
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // Add logic to send formData to your backend
  };

  return (
    <form onSubmit={handleSubmit} className="journal-form">
      <div className="form-group">
        <label htmlFor="date">Date</label>
        <input
          name="date"
          type="date"
          className="form-control"
          value={formData.date}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="content">Content</label>
        <textarea
          name="content"
          className="form-control"
          value={formData.content}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="moodColor">Mood Color</label>
        <select
          name="moodColor"
          className="form-control"
          value={formData.moodColor}
          onChange={handleChange}
        >
          <option value="">Select Mood</option>
          <option value="#FFFF00">Happy</option>
          <option value="#0000FF">Sad</option>
          <option value="#FF0000">Angry</option>
          <option value="#00FF00">Relaxed</option>
          <option value="#808080">Neutral</option>
        </select>
      </div>

      <div className="form-group">
        <label htmlFor="properNutrition">Proper Nutrition</label>
        <input
          type="checkbox"
          name="properNutrition"
          checked={formData.properNutrition}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="properHydration">Proper Hydration</label>
        <input
          type="checkbox"
          name="properHydration"
          checked={formData.properHydration}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="hydrationAmount">Hydration Amount</label>
        <input
          name="hydrationAmount"
          type="number"
          className="form-control"
          value={formData.hydrationAmount}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="properExercise">Proper Exercise</label>
        <input
          type="checkbox"
          name="properExercise"
          checked={formData.properExercise}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="exerciseDuration">Exercise Duration (minutes)</label>
        <input
          name="exerciseDuration"
          type="number"
          className="form-control"
          value={formData.exerciseDuration}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="exerciseDescription">Exercise Description</label>
        <textarea
          name="exerciseDescription"
          className="form-control"
          value={formData.exerciseDescription}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="hoursOfSleep">Hours of Sleep</label>
        <input
          name="hoursOfSleep"
          type="number"
          className="form-control"
          value={formData.hoursOfSleep}
          onChange={handleChange}
        />
      </div>

      <button type="submit" className="btn btn-primary">
        Submit
      </button>
    </form>
  );
};

export default JournalForm;
